import React, { Component } from 'react';
import PropTypes from 'prop-types';

class PokemonDetailTypes extends Component {
  render() {
    return (
      <div>
        <h3>Types</h3>
        {this.props.types.map((item) => {
          return (
            <img
              style={imgStyle}
              src={`https://pokeres.bastionbot.org/images/pokemon/${item}.png`}
              alt={`This is: ${item}`}
              draggable='false'
            />
          );
        })}
      </div>
    );
  }
}

const imgStyle = {
  padding: '10px',
  height: 50,
  width: 50,
};

export default PokemonDetailTypes;
